import React from 'react';
import './'

const NumPad = () => {
  const keys1 = ["7", "8", "9"];
  const keys2 = ["4", "5", "6"];
  const keys3 = ["1", "2", "3"];
  const keys4 = ["0", "ENTER"];

  return (
    <div className='keyboard'>
      <div className='numLine'>
        {keys1.map((key) => (
          <div>{key}</div>
        ))}
      </div>
      {/* <div className='numLine2'>
        {keys2.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='numLine3'>
        {keys3.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='zeroLine'>
        {keys4.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div> */}
    </div>
  );
};

export default NumPad;
